syntax = "proto3";

option java_package = "emu.grasscutter.net.proto";


// Name: DDAGBEPBBEP
message ChannellerSlabLoopDungeonInfo {
    bool is_open = 8;
    uint32 open_time = 15;
    bool is_first_pass_reward_taken = 11;
    uint32 score = 2;
    uint32 dungeon_index = 5;
    repeated uint32 last_condition_id_list = 10;
}

